import './App.css';
import Topbar from './components/Topbar';
import Hero from './components/Hero';
import Grids from './components/Grids';
import Features from './components/Features';
import Partners from './components/Partners';
import Learn from './components/Learn';

function App() {
  return (
    <div className="App">
      <Topbar />
      <Hero />
      <Grids />
      <Features />
      <Partners />
      <Learn />
      <iframe height="519" title="Embedded Wufoo Form" allowtransparency="true" frameborder="0" scrolling="no" src="https://growlah.wufoo.com/embed/z13zbhji1hqhvyt/"></iframe>
    </div>
  );
}

export default App;
